import Vue from "vue";
import VueRouter from "vue-router";
//import HomeView from "../views/HomeView.vue";
import CardsView from "../views/CardsView.vue";
import NotebookView from "../views/NotebookView.vue";
import ResearchView from "../views/ResearchView.vue";
import ImagesView from "../views/ImagesView.vue";
import DayView from "../views/DayView.vue";
import InformationView from "../views/InformationView.vue";
import AboutView from "../views/AboutView.vue";
import BagView from "../views/BagView.vue";

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "home",
    component: DayView,
  },
  {
    path: "/research",
    name: "research",
    component: ResearchView,
    children: [
      { 
        path: "",
       redirect: 'cards'
      },
      { 
        path: "cards",
        name: "cards",
        component: CardsView,
      },
      { 
        path: "notebook",
        name: "notebook",
        component: NotebookView,
      },
      { 
        path: "images",
        name: "images",
        component: ImagesView,
      },
      { 
        path: "information",
        name: "information",
        component: InformationView,
      },
      { 
        path: "about",
        name: "about",
        component: AboutView,
      }, 
      { 
        path: "bag",
        name: "bag",
        component: BagView,
      },
    ]
  },
  {
    path: "/bag",
    name: "bag",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/BagView.vue"),
  },
  {
    path: "/day",
    name: "day",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/DayView.vue"),
  },
  {
    path: "/information",
    name: "information",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/InformationView.vue"),
  },
  {
    path: "/cards",
    name: "cards",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/CardsView.vue"),
  },
  {
    path: "/card/:id",
    name: "card",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/CardView.vue"),
  },
  {
    path: "/image/:id",
    name: "image",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/ImageView.vue"),
  },
  {
    path: "/notebook",
    name: "notebook",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/NotebookView.vue"),
  },
  {
    path: "/images",
    name: "images",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/ImagesView.vue"),
  },
  {
    path: "/save",
    name: "save",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/SaveView.vue"),
  },
  {
    path: "/about",
    name: "about",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/AboutView.vue"),
  },
];

